// Noto Sans Sinhala font for jsPDF
// Generated from NotoSansSinhala-Regular.ttf

export const NotoSansSinhalaBase64 = '';

export function registerSinhalaFont(doc) {
    doc.addFileToVFS('NotoSansSinhala-Regular.ttf', NotoSansSinhalaBase64);
    doc.addFont('NotoSansSinhala-Regular.ttf', 'NotoSansSinhala', 'normal');
    doc.setFont('NotoSansSinhala');
}

export default { NotoSansSinhalaBase64, registerSinhalaFont };
